import axios from "axios";

export const filterSearch = name=> {
    return ( dispatch => {

        axios.get(`http://api.riyofirsan.com/users/findQuery?name=${name}`)

        .then( (response) => {
            dispatch({
                type: 'SEARCH_LIST',
                payload: response.data
            })
        })
    })
}
